import React, { useEffect } from 'react';
import { MapContainer, TileLayer, GeoJSON } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import highSalesData from 'highSalesSuburbs.geojson';

const center = [-37.8136, 144.9631]; // Melbourne's approximate center

function MarketAnalysis() {
    const onEachFeature = (feature, layer) => {
        // Customize each feature (e.g., popup or styling)
        const suburbName = feature.properties.vic_loca_2; // Assuming this is the suburb name field
        layer.bindPopup(`<strong>${suburbName}</strong>`);
        layer.setStyle({ color: 'orange', fillColor: 'orange', fillOpacity: 0.5 });
    };

    return (
        <div style={{ height: '100vh', width: '100%' }}>
            <h1>Market Analysis</h1>
            <MapContainer center={center} zoom={10} style={{ height: '600px', width: '100%' }}>
                <TileLayer
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    attribution="&copy; <a href='https://www.openstreetmap.org/copyright'>OpenStreetMap</a> contributors"
                />
                <GeoJSON data={highSalesData} onEachFeature={onEachFeature} />
            </MapContainer>
        </div>
    );
}

export default MarketAnalysis;
